import React from 'react'
import Fab from '@material-ui/core/Fab'


const theme = createMuiTheme({
palette: {
        common: {
            black:'#000',
            white:'#fff'
        }
        ,background:{
            paper:'#fff',
            default:'#fafafa'
        }
        ,primary:{
            light:'#7986cb',
            main:'rgba(35, 99, 241, 1)',
            dark:'#303f9f',
            contrastText:'#fff'
        }
        ,secondary:{
            light:'#ff4081',
            main:'rgba(221, 7, 44, 0.78)',
            dark:'#c51162',
            contrastText:'#fff'
        }
        ,error:{
            light:'#e57373',
            main:'#f44336',
            dark:'#d32f2f',
            contrastText:'#fff'
        }
        ,text:{
            primary:'rgba(0, 0, 0, 0.87)',
            secondary:'rgba(0, 0, 0, 0.54)',
            disabled:'rgba(0, 0, 0, 0.38)',
            hint:'rgba(0, 0, 0, 0.38)'
        }
    }

});

const styles = theme => ({
  button: {
    margin: theme.spacing.unit,
    padding: 5,
    width: 200,
    height: 100,
    text: 300,
    boxshadow: 4,
  },
  input: {
    display: 'none',
  },
});


export const Player = props => {
  return (
    <div className="optionpage">
      <h1>{'Choose Player One'}</h1>
      <div className="options">
        <Fab 
        onClick={props.onClick} 
        variant="contained" 
          style={
            { 
              marginRight:'50px',
              width: 150,
              height: 150,
              fontSize: '74px', 
              color:'secondary',
          }} 
          color="light"  
          margin="theme.spacing.unit" 
          className="fab"
          value="AI"
          >
          {"X"}
          </Fab>
        <Fab 
        onClick={props.onClick} 
        variant="contained" 
          style={
            { 
              marginRight:'50px',
              width: 150,
              height: 150,
              color: "red",
              fontSize: '74px',
          }} 
          color="light"  
          margin="theme.spacing.unit" 
          className="fab"
          value="AI"
          >

          {"O"}
          </Fab>
      </div>
    </div>
  )
}
